import React from 'react';
import stled from 'styled-components';

export const NoteEdition = ({header, closeIcon, actions, text, close}) => {
    return(
        <div>
            <h1>Hello World</h1>
            <ModalContainer>
            <Header>
                {header}
                {closeIcon  &&  
                    <CloseButton onClick={close}>
                        <MdClose/>
                    </CloseButton>
                }
            </Header>
            <ModalText>Once you delete this note, it won't be possible to undo this
                <br/><br/>action. Are you sure you want do delete it?
            </ModalText>
            {actions}
        </ModalContainer>
        </div>
    );
};
